import './App.scss';
import { Grid } from '@material-ui/core';

function App() {
  return (
    <Grid container direction="column">
      <Grid item>
        ああ
      </Grid>
      <Grid item container>
        <Grid sm={2} />
        <Grid xs={12} sm={8}>
          おお
        </Grid>
        <Grid sm={2} />
      </Grid>
    </Grid>
  );
}

export default App;
